Season 5, Episode 17: Void
Original Air Date 6 April 2006
The lonely Lana gets addicted in a meteor rock cocktail developed by her new acquaintance student of medicine, Lance, which allows the user to have a near-death experience and visit the dead loved relatives and friends. Meanwhile, Clark goes to Honduras, where there is a massive destruction, trying to find Milton Fine and the spacecraft after following a lead from Chloe. When Lana gets in trouble, Clark returns to Smallville but is injected with the serum. In his trip, he meets Jonathan, who tells him that Lionel Luthor knows his secret, while Martha gets close to Lionel.

Season 5, Episode 18: Fragile
Original Air Date 13 April 2006
When the foster mother and chief of staff of Martha's, Naomi, is brutally murdered, her adopted daughter, Maddie stays with Martha and Clark. The girl becomes close to Clark and speaks for the first time in years. But when she discloses her power to shatter glass, she becomes the prime suspect for the death of Naomi and her biological mother after Lois voices her suspicions to it. While Clark investigates the origin of Maddie, her powerful father, who also has the same ability, breaks out of prison and abducts her. Meanwhile, Chloe witnesses Lex and Lana too close to each other, and later she accuses Lex of taking advantage of the vulnerable Lana.


